      <h3 className="text-blue-700 font-bold text-lg mb-2">
        Immediate Cleaning Position Available - Starting at $20.00/Hour
      </h3>

      {/* Company & Location */}
      <p className="text-gray-800 font-medium mb-2">
        <span className="font-semibold">Reliance Contractors</span> - 
        <span> Sandy, OR</span> 
